import React from 'react';
import List from './List'

class Results extends React.PureComponent {

    constructor(props) {
        super(props)
        this.state = {data: {}};
    }   

    render() {
        return (
            <div>
                {this.props.data.length > 0 ? <List results={this.props.data}/> : "no results"}
            </div>
        )
    }
    
}

export default Results;
